/// @title Endless Crawler Chamber Mapper v.2
/// @author Studio Avante
/// @notice Creates Chambers tilemap and parameters for ICrawlerRenderer
//
pragma solidity ^0.8.16;
import { CrawlerContract } from '../CrawlerContract.sol';
import { ICrawlerMapper } from '../ICrawlerMapper.sol';
import { CrawlerMapperV1 } from '../CrawlerMapperV1.sol';
import { MapV1 } from '../MapV1.sol';
import { MapV2 } from './MapV2.sol';
import { Crawl } from '../Crawl.sol';

contract CrawlerMapperV2 is CrawlerContract, CrawlerMapperV1 {

	constructor() {
		setupCrawlerContract('Mapper', 2, 2);
		_tileNames[MapV2.Tile_HatchClosed] = 'HatchClosed';
		_tileNames[MapV2.Tile_HatchDown] = 'HatchDown';
		_tileNames[MapV2.Tile_HatchUp] = 'HatchUp';
	}

	/// @dev implements IERC165
	function supportsInterface(bytes4 interfaceId) public view virtual override(CrawlerContract, CrawlerMapperV1) returns (bool) {
		return CrawlerMapperV1.supportsInterface(interfaceId);
	}

	/// @notice Converts a Chamber's bitmap into a Tiles map
	/// @param chamber The Chamber Data, with bitmap
	/// @return result 256 bytes array of Tiles defined in MapV1, MapV2
	/// @dev Extends the parent function result
	function generateTileMap(Crawl.ChamberData memory chamber) public pure virtual override(CrawlerMapperV1) returns (bytes memory result) {
		result = super.generateTileMap(chamber);
		require(result.length == 256, 'Bad tilemap');
		uint8 hatchPos = uint8(chamber.customData[0].data[0]);
		if(result[hatchPos] != MapV1.Tile_Gem) {
			uint8 hatchDirection = uint8(chamber.customData[0].data[1]);
			result[hatchPos] = hatchDirection == 0 ? MapV2.Tile_HatchClosed : hatchDirection == 1 ? MapV2.Tile_HatchDown : MapV2.Tile_HatchUp;
		}
	}

	/// @notice Returns custom Tile CSS styles
	/// @param chamber The Chamber Data
	/// @return result CSS styles string
	/// @dev Extends the parent function result
	function renderSvgStyles(Crawl.ChamberData memory chamber) public view virtual override(CrawlerMapperV1) returns (string memory) {
		return string.concat(
			super.renderSvgStyles(chamber),
			'#HatchClosed{}'
			'#HatchDown{}'
			'#HatchUp{}'
		);
	}

	/// @notice Returns custom Tile SVG objects
	/// @param chamber The Chamber Data
	/// @return result SVG objects string, with ids to be used in <use>
	/// @dev Extends the parent function result
	function renderSvgDefs(Crawl.ChamberData memory chamber) public pure virtual override(CrawlerMapperV1) returns (string memory) {
		return string.concat(
			super.renderSvgDefs(chamber),
			'<path id="HatchClosed" d="m 0.2 0.2 h 0.6 v 0.6 h -0.6 Z"/>'
			'<path id="HatchDown" d="m 0 0 v 1 h 1 Z"/>'
			'<path id="HatchUp" d="m 0 1 h 1 v -1 Z"/>'
		);
	}

}

